import Logo from "../images/manuel'slogo.png";

const Nav = () => {
	return (
		<nav className="w-screen px-6 py-2 text-black bg-blue-300 flex gap-20">
			<div>
				<img
					src={Logo}
					alt=""
					width={30}
				/>
			</div>
			<div className="w-3/5 bg-red-300 flex gap-5">
				<div>Works</div>
				<div>Resume</div>
				<div>About</div>
			</div>
		</nav>
	);
};

export default Nav;
